import React from 'react';
import ReactDOM from 'react-dom';
import {
    View,
    Panel,
    PanelHeader,
    PanelHeaderBack
} from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

class Courier extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return(
            <Panel>
                <PanelHeader
                left={<PanelHeaderBack onClick={()=>this.setState({activeView: "main"})} />}
                >Курьер</PanelHeader>
            </Panel>
        );
    }
}

export default Courier;
